// src/components/SuccessModal.js
import React from 'react';
import './SuccessModal.css';

function SuccessModal({ onClose }) {
  return (
    <div className="modal-overlay">
      <div className="modal-content">
        <h2 className="success-title">Sincronización exitosa!</h2>
        <p className="success-message">Se completó la sincronización</p>
        <button className="success-button" onClick={onClose}>Continuar</button>
      </div>
    </div>
  );
}

export default SuccessModal;
